import React from "react";
import "./Card.scss";

const Card = (props) => {
  const { CardArr } = props;

  const Cards = CardArr.map((card, index) => {
    return (
      <div key={index} className="Card">
        <h2>{card.suit}</h2>
        <h3>{card.value}</h3>
      </div>
    );
  });

  return <div className="Cards">{Cards}</div>;
};

export default Card;
